#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <math.h>

#define WHITE 0xFFFF
#define BLACK 0x0000
#define PINK  0xF81F
#define BLUE  0x001F
#define RED   0xF800
#define GREEN 0x07E0 
	
#define WIDTH 320
#define HEIGHT 240
	
void load_screen();
void clear_screen(bool clear_text_box);
void wait_for_vsync();
void counting_down();
void draw_block(int x_start, int y_start, int colour, int size);

volatile int* pixel_ctrl_ptr;
volatile int pixel_buffer_start;

int reset;

int canvas[HEIGHT][WIDTH];


void plot_pixel(int x, int y, short int line_color){   
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_maze(short int background_color, short int wall_color) {
    for (int y = 0; y < 240; y++) {
        for (int x = 0; x < 320; x++) {
            short int color;
            if (canvas[y][x] == 0) { // background
                color = background_color;
            } else { // wall
                color = wall_color;
            }
            plot_pixel(x, y, color);
        }
    }
}

void loadCanvas(const char *filename) {
    FILE *file = fopen(filename, "r");
    if (file == NULL) {
        perror("Error opening file");
        return;
    }

    for (int i = 0; i < 240; i++) {
        for (int j = 0; j < 320; j++) {
            if (fscanf(file, "%d,", &canvas[i][j]) != 1) {
                perror("Error reading file");
                fclose(file);
                return;
            }
        }
    }

    fclose(file);
}

short int sphereCanvas[HEIGHT][WIDTH];

// Initialize sphere_canvas array to zero
void init_sphere_canvas() {
    for (int y = 0; y < HEIGHT; y++) {
        for (int x = 0; x < WIDTH; x++) {
            sphereCanvas[y][x] = 0;
        }
    }
}

// Fill the sphereCanvas with the filled circle
void draw_filled_circle_in_array(int center_x, int center_y, int radius) {
    for (int y = -radius; y <= radius; y++) {
        for (int x = -radius; x <= radius; x++) {
            if (x * x + y * y <= radius * radius) {
                int canvasX = center_x + x;
                int canvasY = center_y + y;
                if (canvasX >= 0 && canvasX < WIDTH && canvasY >= 0 && canvasY < HEIGHT) {
                    sphereCanvas[canvasY][canvasX] = 1; // Assuming 1 represents sphere
                }
            }
        }
    }
}

void combine_and_draw(short int background_color, short int wall_color, short int circle_color) {
    for (int y = 0; y < HEIGHT; y++) {
        for (int x = 0; x < WIDTH; x++) {
            short int color;
            if (sphereCanvas[y][x] == 1) {
                // If the pixel is part of the circle
                color = circle_color;
            } else if (canvas[y][x] == 1) {
                // If the pixel is part of the wall
                color = wall_color;
            } else {
                // Background
                color = background_color;
            }
            plot_pixel(x, y, color);
        }
    }
}

int main(void)
{

  /*************************Initializing front/back pixel buffer ****************************/
	
  pixel_ctrl_ptr = (int *)0xFF203020; //pointing at the front buffer
  *(pixel_ctrl_ptr + 1) = 0xC8000000; //first store the address in the back buffer
  wait_for_vsync();
  //Initialize the base address to the first pixel in the front buffer(On-chip)
  pixel_buffer_start = *pixel_ctrl_ptr;

  //Initializing 320x240 pixels in the front buffer
  load_screen(); // pixel_buffer_start points to the pixel buffer

  *(pixel_ctrl_ptr + 1) = 0xC0000000; //set back pixel buffer to start of SDRAM memory
  pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

  //Initializing 320x240 pixels in the back buffer(SDRAM)
  load_screen();
  wait_for_vsync();
	

  draw_maze(PINK, BLACK);
	
  draw_filled_circle_in_array(290, 205, 10);
	
  combine_and_draw(WHITE, BLACK, BLUE);
	

  //plot_filled_circle(290, 205, 10, BLACK);
	
  return 0;
}

void load_screen() {
    //Redraw whole 320x240 VGA screen to WHITE
    for (int x = 0; x < 320; x++) {
        for (int y = 0; y < 240; y++) {
            plot_pixel(x, y, WHITE);//Plotting black pixel all over the VGA display
        }
    }
}

void wait_for_vsync(){
    volatile int* pixel_ctrl_ptr = (int *) 0xFF203020;  //pixel controller of front buffer address
    register int status; //the status register
    
    *pixel_ctrl_ptr = 1;    //start the synchronization procress by writing 
            // the value 1 into the front Buffer register in the pixel buffer controller
    
    status = *(pixel_ctrl_ptr + 3); // Wait for the S bit to become 0, that means VGA sweep is done
    //3*(4 bits) = 12 bits = 0xFF20302C

    //Polling to get status bit
    while ((status & 0x01) != 0) { //wait until bit S of the Status register becomes equal to 0
        status = *(pixel_ctrl_ptr + 3);
    }
}

void clear_screen(bool clear_text_box) {
  if(!clear_text_box){ //clear the whole screen
    for (int x = 0; x < 320; x++) {
        for (int y = 0; y < 240; y++) {
            plot_pixel(x, y, WHITE);//Plotting black pixel all over the VGA display
        }
    }
  }else{
    for (int x = 31; x < 300; x++) { 
        for (int y = 41; y < 230; y++) {
            plot_pixel(x, y, WHITE);//Plotting black pixel all over the VGA display
        }
    }
  }
}

